import {React, useEffect} from 'react';

const NotFound = () => {
    useEffect(() => {
        document.title = "Page Not Found";
    }, []);
    return (
        <div
            className='m-5 position-absolute top-0 start-50 translate-middle'>
            <title>Not Found</title>
            <h2>ERROR-404</h2>
            <h5>Page Not Found</h5>
        </div>
    );
};

export default NotFound;
